import React, { FC } from 'react';
import styled from 'styled-components';
import Header from './Header';

const layoutStyle = {
  margin: -10,
  padding: 0,
};



interface Props {
  children: React.ReactNode;
}

const Layout: FC<Props> = props => (
  <StyledLayout style={layoutStyle}>
    <Header />
    {props.children}
  </StyledLayout>
);

export default Layout;
